import { AntDesign } from '@expo/vector-icons';
import React from 'react';
import {Text, View,Image,TouchableOpacity} from 'react-native';
import { TextInput } from 'react-native-paper';
const YourApp = () => {
  return (
    <View
      style={{
        flex: 1,
        backgroundColor: '#FFFFFF'
      }}>

      <View style={{flex: 1, alignItems: 'center'}}>
          <Text style={{fontSize: 28, fontWeight: 'bold'}}>REGISTER</Text>

      </View>

      <View style={{flex: 1}}>
          <TextInput placeholder='Name' style={{margin: 15}} ></TextInput>
          <TextInput placeholder='Phone' style={{margin: 15}} ></TextInput>
          <TextInput placeholder='Email' style={{margin: 15}} ></TextInput>
          <TextInput placeholder='Password' style={{margin: 15}} right={<TextInput.Icon icon="eye"/>}></TextInput>
          <TextInput placeholder='Birthday' style={{margin: 15}} ></TextInput>
          <View style={{flexDirection: 'row'}}>
              <TouchableOpacity style={{marginLeft: 20,width: 30,height:30,borderRadius: 15}}>
              </TouchableOpacity>
              <Text style={{fontSize: 16,marginLeft: 5}}>Male</Text>

          </View>
      </View>






    </View>
  );
};

export default YourApp;
